import { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import ApiRides from '../apis/ApiRides';
import DateFunc from './DateFunc';
import './Rides.css';

const Rides = () => {

    const { ridesState } = useSelector( state => state.rideStore )

    const dispatch = useDispatch();

    useEffect(() => {
       try{
            ApiRides( dispatch )
       }catch(err){
           console.log(err)
       }
    }, [])

    return(
        <div className="rides">
            <div className="container">
                { ridesState !== undefined && 
                    ridesState.map( (el, indx) => {
                        if(indx < 4){
                            return(
                                <div className="ride-single" key={ el.id }>
                                    <div className='ride-single-content'>
                                        <div className='ride-single-img'></div>
                                        <div className='ride-single-data'>
                                            <h2>Ride Id : <span>{ el.id }</span></h2>
                                            <h2>Origin Station : <span>{ el.id }</span></h2>
                                            <h2>station_path : <span>[20, 39, 40, 42, 54, 63, 72, 88, 98]</span></h2>
                                            <h2>Date : <span>{`
                                                                ${DateFunc(el.date).day}th 
                                                                ${DateFunc(el.date).month} 
                                                                ${DateFunc(el.date).year} 
                                                                ${DateFunc(el.date).hours}:${DateFunc(el.date).minutes}
                                                            `}</span></h2>
                                            <h2>Distance : <span>0</span></h2>
                                        </div>
                                    </div>
                                    <div className='ride-single-option'>
                                        <div>{ el.city }</div>
                                        <div>{ el.state }</div>
                                    </div>
                                </div>
                            )
                        }
                    }) }
            </div>
        </div>
    )
}
export default Rides;
